import React from 'react';
import logo from '../Images/logo.png';

const Footer = () => {
    return (
        <>
            <section className="footer">
                <div className="d-flex flex-row m-auto logoName">
                    <img src={logo} alt="" className="logostyle" />
                    <h5>opus</h5>
                </div>
                <div>
                    <ul>
                        <li>Overiew</li>
                        <li>Landings</li>
                        <li>Company</li>
                        <li>Pricing</li>
                        <li>CMS Pages</li>
                        <li>Accounts</li>
                        <li>Buy for Figma</li>
                    </ul>
                </div>
            </section>
        </>
    );
};

export default Footer;
